import React, { Component } from 'react';
import './Navbar.css'
import Logo from './images/logo.png';

class Navbar extends Component{
    render() {
      return (
          <div className="Navbar">
              <a href="https://www.facebook.com/JhemaCm"
              target="_blank">
              <img className="LOGO" src={Logo} alt="Logo" />
              </a>
              <div>
                  <ul>
                      <li>
                        <a className="Navbar__Port" href="#Portafolio">Portafolio</a>
                        <a className="Navbar__Port" href="#Experiencias">Experiencia</a>
                        <a className="Navbar__Port_Border" href="#Contactanos">Contactanos</a>
                      </li>
                  </ul>
              </div>
          </div>
      )
    }
}

export default Navbar;
